var frFR={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'Une erreur Metamask a causé la déconnexion de votre portefeuille. Rechargez la page pour la reconnecter'.","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Autoriser","Allow in your wallet":"Autoriser dans votre portefeuille","Allow {symbol} first":["Autoriser ",["symbol"]," en premier"],"Allowance pending":"Allocation en attente","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Une erreur s'est produite lors de la tentative d'exécution de cet échange. Vous devrez peut-être augmenter votre tolérance au slippage. Si cela ne fonctionne pas, il peut y avoir une incompatibilité avec le token que vous échangez. Remarque : les frais sur les token de transfert et de rebase sont incompatibles avec Uniswap V3.","Approval pending":"En attente d'approbation","Approve":"Approuver","Approve Permit2":"Approve Permit2","Approve in your wallet":"Approuvez dans votre portefeuille","Approve {0} for trading":["Approuver ",["0"]," pour le trading"],"Approve {symbol} first":["Approuver ",["symbol"]," en premier"],"Auto":"Automatique","Auto Router":"Routeur automatique","Auto Router API":"Auto Router API","Balance:":"Solde :","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Annuler","Close":"Fermer","Confirm in your wallet":"Confirmez dans votre portefeuille","Confirming approval":"Confirming approval","Connect to {0}":["Connexion à ",["0"]],"Connect wallet":"Connecter le portefeuille","Connecting…":"Connexion…","Continue":"Continuer","Convert {0} to {1}":["Convertir ",["0"]," en ",["1"]],"Convert {0} to {1} with no slippage":["Convertir ",["0"]," en ",["1"]," sans slippage"],"Disconnect wallet":"Déconnecter le portefeuille","Dismiss":"Refuser","Enter an amount":"Saisissez un montant","Error fetching trade":"Erreur lors de la récupération de l'échange","Exchange rate":"Taux de change","Expected output":"Sortie attendue","Fetching best price…":"Recherche du meilleur prix…","Get support":"Obtenir de l'aide","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Un glissement élevé augmente le risque de mouvement des prix","I don't have a wallet":"Je n'ai pas de portefeuille","Insufficient liquidity":"Liquidité insuffisante","Insufficient {0} balance":["Solde ",["0"]," insuffisant"],"Invalid recipient":"Destinataire invalide","Max":"Max","Max slippage":"Glissement maximum","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Dépendances manquantes","Network fee":"Frais de réseau","No results found.":"Aucun résultat trouvé.","No tokens are available on this network. Please switch to another network.":"Aucun jeton n'est disponible sur ce réseau. Veuillez passer à un autre réseau.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["La sortie est estimée. Vous recevrez au moins ",["minReceivedString"]," ou la transaction sera annulée."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["La sortie est estimée. Vous allez vendre au plus ",["maxSentString"]," ou la transaction sera annulée."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Veuillez saisir un pourcentage de glissement valide","Powered by the Uniswap protocol":"Propulsé par le protocole Uniswap","Price impact":"Impact sur les prix","Price updated":"Prix mis à jour","Reload":"Rafraîchir","Reload the page":"Recharge la page","Request rejected":"Request rejected","Review swap":"Vérifier l'échange","Search by token name or address":"Recherche par nom de jeton ou adresse","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Un problème est survenu","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Succès","Swap":"Échanger","Swap failed: {0}":["Échec de l'échange : ",["0"]],"Switch network":"Changer de réseau","Switch network in your wallet":"Changez de réseau dans votre portefeuille","Switching network":"Réseau de commutation","Test Title":"Titre du Test","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"L'invariant Uniswap x*y=k n'a pas été satisfait par l'échange. Cela signifie généralement que l'un des jetons que vous échangez incorpore un comportement personnalisé lors du transfert.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Le jeton d'entrée ne peut pas être transféré. Il peut y avoir un problème avec le jeton d'entrée.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Le jeton de sortie ne peut pas être transféré. Il peut y avoir un problème avec le jeton de sortie.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Le token de sortie ne peut pas être transféré. Il peut y avoir un problème avec le token de sortie. Remarque : les frais sur les jetons de transfert et de rebase sont incompatibles avec Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"Cette transaction n'a pas pu être envoyée car la date limite est passée. Veuillez vérifier que la date limite de votre transaction n'est pas trop basse.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Cette transaction ne réussira pas en raison du mouvement des prix. Essayez d'augmenter votre tolérance au slippage. Remarque : les frais sur les token de transfert et de rebase sont incompatibles avec Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Cette transaction ne réussira pas en raison du mouvement des prix ou des frais de transfert. Essayez d'augmenter votre tolérance au glissement.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Date limite de la transaction","Transaction rejected":"Transaction rejetée","Transaction submitted":"Transaction soumise","Try again":"Réessayer","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Essayez d'augmenter votre tolérance au glissement.<0/>REMARQUE : les frais de transfert et de rebase tokens sont incompatibles avec Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Erreur inattendue. Impossible d'estimer le gaz pour l'échange.","Unexpected issue with estimating the gas. Please try again.":"Problème inattendu avec l'estimation du gaz. Veuillez réessayer.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Voir sur Etherscan","Wallet disconnected":"Portefeuille déconnecté","Warning":"Avertissement","You pay":"Vous payez","You receive":"Vous avez reçu","Your swap failed.":"Votre swap a échoué.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Votre échange a été modifié via votre portefeuille. Si c'était une erreur, veuillez annuler immédiatement ou vous risquez de perdre vos fonds.","Your transaction will revert if it has been pending for longer than this period of time.":"Votre transaction sera annulée si elle est en attente depuis plus longtemps que cette période.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Votre transaction sera annulée si le prix change défavorablement de plus de ce pourcentage.","minutes":"minutes","price impact on the market price of this pool. Do you wish to continue?":"impact sur le prix du marché de ce pool. Voulez-vous continuer ?","{0} approval failed":["L'approbation de ",["0"]," a échoué"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Essayez d'augmenter votre tolérance au glissement.\nRemarque : les jetons de frais de transfert et de rebase sont incompatibles avec Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," frais"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

